import "./App.css";
import Navbar from "./components/Navbar";
import Main from "./components/Main";
import { BrowserRouter as Router } from "react-router-dom";

function App() {
  function handleClick(e) {
    const cartModal = document.querySelector(".cart-modal");
    const tmbnList = document.querySelectorAll(".product li");

    if (e.target.tagName === "svg" || e.target.tagName === "path") {
      cartModal.classList.toggle("hidden");
    } else {
      cartModal.classList.add("hidden");
    }

    if (e.target.classList.contains("tmbn")) {
      tmbnList.classList.add("outline-primary-1");
    } else {
      tmbnList.classList.remove("outline-primary-1");
    }

    // console.log(e.target.getAttribute("alt"));
    console.log(e.target);
    console.log(tmbnList);
  }

  return (
    <Router>
      <div className="App  lg:w-3/4 md:w-4/5 mx-auto font-body">
        <Navbar handleClick={handleClick} />
        <Main handleClick={handleClick} />
      </div>
    </Router>
  );
}

export default App;
